svg.script:
webMI.libraryLoader.load([], ["CSS/main.css"], function() {
var trigger = "AGENT.OBJECTS.Set_var.SetVarValues";
var currentNodeAddressArray = ["AGENT.OBJECTS.ASPD.APD1.Speed.Drill.Limit",
								"AGENT.OBJECTS.ASPD.APD1.Load.Drill.Limit",
								"AGENT.OBJECTS.ASPD.APD1.Diff_Pressure.Drill.Limit", 
								"AGENT.OBJECTS.ASPD.APD1.Torque.Limit"
							];
var nodeAddressArray = ["AGENT.OBJECTS.Set_var.Drill_speed_limit.Drill_speed_limit_value",
						"AGENT.OBJECTS.Set_var.Load_on_bit_limit.Load_on_bit_limit_value",
						"AGENT.OBJECTS.Set_var.Diff_pressure_limit.Diff_pressure_limit_value",
						"AGENT.OBJECTS.Set_var.TDS_torque_limit.TDS_torque_limit_value"
						];

function throwWindow(bool) {

	if (bool) webMI.display.openWindow({
		display: "SYSTEM.LIBRARY.PROJECT.OBJECTDISPLAYS.LimitationsPopUp.PopUp2",
		extern: false,
		height: 400,
		width: 630,
		menubar: false,
		modal: true,
		movable: true,
		resizable: false,
		scrollbars: false,
		status: false,
		title: "Загрузка уставок",
		toolbar: false,
		query: webMI.query
	})
	else alert("Для отправки запроса необходимо изменить значения в полях")
}

function addListeners() {

	var arrayOfIndexes = [];
	for (i in currentNodeAddressArray) {
		arrayOfIndexes.push("id_get_" + currentNodeAddressArray[i].replace(/AGENT\.OBJECTS\.Set_var\./, "").replace(/_limit/, "").toLowerCase());
	}

	webMI.data.subscribeBlock(currentNodeAddressArray, function(e) {
		for (i in arrayOfIndexes) {
			console.log(e);
			console.log(arrayOfIndexes[i])
			webMI.gfx.setText(arrayOfIndexes[i], e[i].value.toFixed(2));
		}

	})
}

addListeners()


function fillParams(array) {
	webMI.query["limitations"] = array.join(",");
}

function matchArrays(arr1, arr2, func) {
	console.log(arr1,arr2)
	for (j in arr1) {
		if (arr1[j].value != arr2[j].value) {
		    func()
		}
	}	
}

document.getElementById('ComitButton').addEventListener("click", function() {
	webMI.data.read(trigger, function(res) {
		if (!res.value) {	
			webMI.data.write(trigger, true); 
		}   

		webMI.data.read(nodeAddressArray, function(f) {
			webMI.data.read(currentNodeAddressArray, function(el) {
				var valuesToChange = [];
				var every = true;

				fillParams(valuesToChange);

				matchArrays(f, el, function() { 
				  every = false;
				});

				if (!every) {
					fillParams(nodeAddressArray);
					console.log(webMI.query["limitations"])
					throwWindow(true);
				}
				else throwWindow(false);
			})
		})
    })
}, false);

})


document.getElementById('speed_p').addEventListener('click',function(e){
	webMI.data.read('AGENT.OBJECTS.Set_var.Drill_speed_limit.Drill_speed_limit_value',function(f){
		webMI.data.write('AGENT.OBJECTS.Set_var.Drill_speed_limit.Drill_speed_limit_value',f.value+1)
	})
})
document.getElementById('speed_m').addEventListener('click',function(e){
