document.getElementById("recomm").addEventListener("click", function() {
	webMI.display.openDisplay("AGENT.DISPLAYS.NewView.Halliburton.Halliburton", {}, "main_frame")
});

function signalSettingsControl() {
	if (!webMI.hasRight("USER." + "SignalControl")) return
	var sContainer = document.getElementById("secretContainer")

	var btn = parent.document.createElement("button")
	btn.classList.add("button__label-dark")
	btn.textContent = "Управление сигналами"

	sContainer.appendChild(btn)

	btn.addEventListener("click", function() {
		webMI.display.openDisplay("AGENT.DISPLAYS.NewView.SignalControl.ControlPanel", {}, "main_frame")		
	})

}
signalSettingsControl()
